search/search-basics.html.body:
Search
A query tree structure, along with order and paging specifiers, allows a search to be performed against indexed documents held in ElasticSearch. The query API allows any required sub-query structure to be defined and a comprehensive selection of Operators enable individual field level evaluation.

Query
Sub-queries
Ordering
Paging
Weighting
Specifying fields
Complete example

search(query: Query): Promise>;

Query
This example demonstrates a simple search with default ordering and paging options.
(function(Zengenti) {

    var client = Zengenti.Contensis.Client.create();
    var Query = Zengenti.Contensis.Query;
    var Op = Zengenti.Contensis.Op;

    var query = new Query(
        Op.contains('title', 'Batman'),
        Op.greaterThan('runtime', 200)
    );

    client.entries.search(query).then(function(films) {
        // films are available
        // films.pageIndex
        // films.pageSize
        // films.totalCount
        // films.items

    }, function(error) {
        console.error(error);
    });  

})(Zengenti);

Sub-queries
A sub-query is a query within another query that is used as a condition to further restrict the results. Effectively they are defined by an explicit nesting of logical operators.
This example demonstrates a simple search with a sub-query.
var query = new Query(
    Op.contains('title', 'Batman'),
    Op.or(
        Op.greaterThan('releaseDate', 1960),
        Op.contains('tagline', 'gotham')
    )
);

Ordering
Results can be ordered by one or more fields in an ascending or descending direction. Order clauses are prioritised in the order that they are added. By default, if no order clauses are specified then the entry results are ordered by the EntryTitle in an ascending direction.
var OrderBy = Zengenti.Contensis.OrderBy;

Ascending order
Order by 'releaseDate' in an ascending direction.
query.orderBy = OrderBy.asc('releaseDate');

Descending order
Order by 'releaseDate' in a descending direction.
query.orderBy = OrderBy.desc('releaseDate');

Multiple clauses
Multiple order clauses.
query.orderBy = OrderBy.asc('title').desc('releaseDate');

Paging
Paging allows the number of results to be restricted to a defined count so that the results are easier to handle and ensures a response is returned quickly. The page number can also be specified to allow which set of results is to be returned.
The page number can also be specified to allow which set of results is to be returned.
query.pageSize = 50;
query.pageIndex = 1;

Weighting
All query operators can have a weight applied.
var query = new Query(
  Op.equalTo('first', 7).weight(10)
);

Specifying fields
System fields
System fields such as id, contentTypeId, projectId, versionNo etc. are under the sys object and can be accessed using a dot notation, e.g. sys.id, sys.contentTypeId, sys.projectId, sys.version.versionNo.
The entryTitle field is a dynamic value, determined by the EntryTitleField value in the content type.
Data fields
Fields defined in the content type for the entry can be accessed by their API id.
Complete example
(function(Zengenti) {
    var client = Zengenti.Contensis.Client.create();
    var Query = Zengenti.Contensis.Query;
    var Op = Zengenti.Contensis.Op;
    var OrderBy = Zengenti.Contensis.OrderBy;
    var query = new Query(
        Op.contains('title', 'Batman'),
        Op.or(
            Op.greaterThan('releaseDate', 1960),
            Op.contains('tagline', 'gotham')
        )
    );
    query.orderBy = OrderBy.asc('title').desc('releaseDate');
    query.pageSize = 50;
    query.pageIndex = 1;

    client.entries.search(query).then(function(films) {
        // films are available
        // films.pageIndex
        // films.pageSize
        // films.totalCount
        // films.items

    }, function(error) {
        console.error(error);
    });
})(Zengenti);

search/query-operators.html.body:
Query operators

And
Or
Not
Between
Contains
EndsWith
EqualTo
Exists
FreeText
GreaterThan
GreaterThanOrEqualTo
In
LessThan
LessThanOrEqualTo
StartsWith

Logical operators
And
This would return any document where first is 1 AND second is 2.
var query = new Query(
        Op.and(
            Op.equalTo('first', 1),
            Op.equalTo('second', 2)
        )
    );

The And operator is the default logical operator and is not required to be specified explicitly.
var query = new Query(
        Op.equalTo('first', 1),
        Op.equalTo('second', 2)
    );

Or
The example would return any document where first is 1 OR second is 2.
var query = new Query(
        Op.or(
            Op.equalTo('first', 1),
            Op.equalTo('second', 2)
        )
    );

Not
The not expects an inner operator so in the example any document where first is NOT equal to 7 would be returned.
var query = new Query(
        Op.not(Op.equalTo('first', 7))
    );

Relational & equality operators
Between
In this example, if our field is between 18 and 45 inclusive it would match.
var query = new Query(
    Op.between('age', 18, 45)
);

Contains
This would match on a field called description containing the phrase batman.
var query = new Query(
    Op.contains('description', 'batman')
);

EndsWith
This would find any item that has a field called wordField with a value ending with ing.
var query = new Query(
    Op.endsWith('wordField', 'ing')
);

EqualTo
This would find any item that has a field called blends with a value exactly matching 5. For string fields, the comparison is case-insensitive.
var query = new Query(
    Op.equalTo('blends', 5)
);

Exists
In the example any document that has a field called fieldName would be returned. You can use a value of false if you want documents that do not contain a given field.
var query = new Query(
  Op.exists('fieldName', false)
);

FreeText
In the example the field synopsis is searched upon for any words that match gotham or dark or knight.
var query = new Query(
  Op.freeText('synopsis', 'gotham dark night')
);

GreaterThan
In the example any item that has a field called first and a value that is greater than 7 would be returned.
var query = new Query(
  Op.greaterThan('first', 7)
);

GreaterThanOrEqualTo
In the example any item that has a field called first and a value that is greater than or equal to 7 would be returned.
var query = new Query(
  Op.greaterThanOrEqualTo('first', 7)
);

In
In the example any document that where the field first is equal to 1,7 or 11 would be returned. The values should be of the same type, in this case integer.
var query = new Query(
  Op.in('first', 1, 7, 11)
);

LessThan
In the example any item that has a field called first and a value that is less than 7 would be returned.
var query = new Query(
  Op.lessThan('first', 7)
);

LessThanOrEqualTo
In the example any item that has a field called first and a value that is less than or equal to 7 would be returned.
var query = new Query(
  Op.lessThanOrEqualTo('first', 7)
);

StartsWith
In the example if the name field contains a value starting with war it would match.
var query = new Query(
  Op.startsWith('name', 'war')
);
